/**
 * 获取城市信息onclick="append_city('{:U(\'find_start_city\')}')"
 * @param obj
 */
$(document).on('click','#start_name_wrap',function(event){
	var url = $(this).attr('data-url')
	 if($('#citylist').text() == ''){
        $.ajax({
            type:'get',
            url:url,
            dataType:'json',
            success:function(citys_val){
                for (var i = 0; i < citys_val.length; i++) {
                    var  first_letter = citys_val[i]['first_letter'].charCodeAt(0);
                    if(citys_val[i]['is_hot'] == 1){
                        hot += '<li class="click"><span title="'+citys_val[i]['name']+'" onclick="change_city_val(&quot;'+citys_val[i]['id']+'&quot;,&quot;'+citys_val[i]['name']+'&quot;,&quot;'+citys_val[i]['pinyin']+'&quot;)">'+citys_val[i]['name']+'</span></li>';
                    }

                    /* A-G */
                    if(first_letter >= '97' && first_letter <= '103'){
                        pingy1 +='<li class="click"><span title="'+citys_val[i]['name']+'" onclick="change_city_val(&quot;'+citys_val[i]['id']+'&quot;,&quot;'+citys_val[i]['name']+'&quot;,&quot;'+citys_val[i]['pinyin']+'&quot;)">'+citys_val[i]['name']+'</span></li>';
                    }
                    /* H-L */
                    else if(first_letter >= '104' && first_letter <= '108'){
                        pingy2 +='<li class="click"><span title="'+citys_val[i]['name']+'"onclick="change_city_val(&quot;'+citys_val[i]['id']+'&quot;,&quot;'+citys_val[i]['name']+'&quot;,&quot;'+citys_val[i]['pinyin']+'&quot;)">'+citys_val[i]['name']+'</span></li>';
                    }
                    /* M-T */
                    else if(first_letter >= '109' && first_letter <= '116'){
                        pingy3 +='<li class="click"><span title="'+citys_val[i]['name']+'" onclick="change_city_val(&quot;'+citys_val[i]['id']+'&quot;,&quot;'+citys_val[i]['name']+'&quot;,&quot;'+citys_val[i]['pinyin']+'&quot;)">'+citys_val[i]['name']+'</span></li>';
                    }
                    /* U-Z */
                    else{
                        pingy4 +='<li class="click"><span title="'+citys_val[i]['name']+'" onclick="change_city_val(&quot;'+citys_val[i]['id']+'&quot;,&quot;'+citys_val[i]['name']+'&quot;,&quot;'+citys_val[i]['pinyin']+'&quot;)">'+citys_val[i]['name']+'</span></li>';
                    }
                }
                cityareaz +=(hot+'</ul>'+pingy1+'</ul>'+pingy2+'</ul>'+pingy3+'</ul>'+pingy4+'</ul>'+'</div>');
                if($("#citylist").text()==""){
                    $("#citylist").append(cityareaz);
                }
            }
        });
    }
    $('#city').show().css('left',$('#start_name_wrap').offset().left).css('top',$('#start_name_wrap').offset().top+$('#start_name_wrap').innerHeight());
    $('#trip_dialog').hide();
    event.stopPropagation();
})
