function change_city_val(id,city, pinyin_city)
{
	var fls = sifc(arr,city);
	if(!fls){return false};
	arr.push(city);
	arrid.push(id);
	var old_html = $('#start_name_wrap').html();
	$('#start_name_wrap').html(old_html+'<lable class="tipsss">'+city+'<span data-f="1" data-name="'+city+'" data-id="'+id+'" class="tipsssclose">×</span></lable>').removeClass('nopad').addClass('haspad');
	$('#start_name').attr('value',arr);
	$('#start_id').attr('value',arrid);
    $('#city').hide();
    $('#start_name_wrap').removeClass('hello')
}

// 判断是否重复
function sifc(ars,city_name)
{
	var fls=true;;
	for (var i = ars.length - 1; i >= 0; i--) {
		if(ars[i]==city_name)
		{
			layer.msg('已存在');
			fls = false;
			return false;
		}
	};
	return fls;
}
//删除
$(document).on('click','.tipsssclose',function(event){
	var name = $(this).attr('data-name');
	var id = $(this).attr('data-id');
	var f = $(this).attr('data-f');
	if(f==1)
	{
		delfud(arr,arrid,name,id,this,f);
	}else{
		delfud(triparr,triparrid,name,id,this,f);
	}
	event.stopPropagation(); 
})

// 删除已选的出发地或目的地
function delfud(arr1,arr2,name,id,obj,f){
	arr1.removeByValue(name);arr2.removeByValue(id);
	if(f==1)
	{
		$('#start_name').attr('value',arr1);
		$('#start_id').attr('value',arr2);
		if(arr1.length==0){$('#start_name_wrap').removeClass('haspad').addClass('nopad');}
	}else{
		$('#trip_name').attr('value',triparr);
    	$('#trip_id').attr('value',triparrid);
    	if(arr1.length==0){$('#trip_name_wrap').removeClass('haspad').addClass('nopad');}
	}
	$(obj).parent().remove();
}
Array.prototype.removeByValue = function(val) {
  for(var i=0; i<this.length; i++) {
    if(this[i] == val) {
      this.splice(i, 1);
      break;
    }
  }
}
function tabCutover(c,d){
    $(c).parent().children().removeClass("current");
    $(c).addClass("current");
    $("."+d).parent().children().hide();
    $("."+d).show();
}